import React from "react";
import "./Header.css";

const Header = () => (
  <header className="jumbotron text-center">
    <h1>(ReactJS) New York Times Article Scrubber</h1>
    <h3>Search for and save articles of interest.</h3>
  </header>
);

export default Header;
